import React from 'react';
import './index.css';
import * as serviceWorker from './serviceWorker';
import '@fortawesome/fontawesome-free/css/all.css'
import {rerenderTree} from "./render";
import state from "./redux/state";

rerenderTree(state);

serviceWorker.unregister();
